CREATE TABLE contracts (
        id INTEGER NOT NULL,
        institution_id INTEGER NOT NULL,
        name VARCHAR(50),
        announced DATETIME,
        created DATETIME,
        valid_until DATETIME,
        description VARCHAR(50),
        value NUMERIC,
        supplier_id INTEGER,
        PRIMARY KEY (id),
        FOREIGN KEY (supplier_id) REFERENCES suppliers (id)
);

